INSERT INTO `product` VALUES (1, '初恋', 'drinks', 15, '支据不记都平却处情照理特少己众知。反传再于界层素学开指什保南声部和。身现交段它成把样半科使南值影南步日。也用生它方记子来情看市气在电万受复。铁火治边节却真总里经二资养。', '/image/d1.png', '2020-05-14 22:47:26', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (2, '圣代', 'drinks', 14, '率华信了打交也将计家需政团维且。济音状强议县统运府战族个。造回低行里眼业院儿明专土家低革代际。写现分样手由周用自打运速产作。', '/image/d2.png', '2020-05-14 22:47:29', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (3, '清凉夏日', 'drinks', 8, '况近解能最证清回广太们民没资用即需。心王使保个口有连适到着西始叫话。科对千压务代电委每龙置周写中红东统。个平毛体交市联元养维家积道物。算门红革计真如适低持团下其件多共。', '/image/d3.png', '2020-05-14 22:47:32', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (4, '青柠汁', 'drinks', 7, '手清节长每以业也体风王工难建京思西能。流委力必拉备由间本化结火石发。', '/image/d4.png', '2020-05-16 09:55:16', '2020-05-16 21:59:59', NULL);
INSERT INTO `product` VALUES (5, '巧克力奶茶', 'drinks', 14, '极界查的然少利效易及才多水厂号组员得。圆合运他照开酸院严天权北气它或且打。', '/image/d5.png', '2020-05-16 09:55:21', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (6, '雪顶咖啡', 'drinks', 15, '道数离起党原求越引可己压任制车备东日。只照不山取日个示油说方同达。指全万际原建他这更为民南中九次。', '/image/d6.png', '2020-05-16 09:55:25', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (7, '星云', 'drinks', 20, '加报必单斗当府不段革识可院己。油铁两心圆响定队受那极角面类以又。', '/image/d7.png', '2020-05-16 09:55:28', '2020-05-16 21:59:54', NULL);
INSERT INTO `product` VALUES (8, '柠檬蜜柑茶', 'drinks', 16, '理干即青选区什克近相最志本史。转明制线委切选路织导议油根内细。级各实记现马济论住四百标造党象选结。', '/image/d8.png', '2020-05-16 09:55:32', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (9, '芝士蛋糕', 'dessert', 18, '报按想之书受国又复积国科成温们支此。作眼场派精红北无易九通更。据万料事切设运间展以示世号些清压线。', '/image/s1.png', '2020-05-16 09:55:36', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (10, '蜂蜜冰淇淋千层', 'dessert', 20, '参物候拉几标式青起求面立。织管约比劳北油计定开示音连万报。展改斯七那你和火品生声问重。造才结地构眼斯确算深通区每支少。', '/image/s2.png', '2020-05-16 09:55:39', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (11, '草莓冰淇淋蛋糕', 'dessert', 17, '产格发按体厂速通直接派斗提标。认学收记积空已听直意为他所气。许月打方更路图看件日细织难后严基比实。', '/image/s3.png', '2020-05-16 09:55:42', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (12, '草莓泡芙', 'dessert', 8, '么立七调队对指热共先水当要家。命引后写近改位定得存细般。开件式路文也有线什证话值级复温发置。于律日业第应先消立便可位斯因参。', '/image/s4.png', '2020-05-16 09:55:46', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (13, '草莓巧克力塔', 'dessert', 12, '便越多声据型些难之收向指织入层商。接资变指素道济实开长电知江区影。影题复一叫导石育车办院通问接。', '/image/s5.png', '2020-05-16 09:55:50', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (14, '蓝莓牛奶蛋糕', 'dessert', 15, '合各应难质义安论下很至这况很全十阶引。长五级人回标了得头米员三必称。', '/image/s6.png', '2020-05-16 09:55:54', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (15, '覆盆子派', 'dessert', 22, '精表查队长后反事求小自立们往。社听音容没什县风深反清图发布近教京品。', '/image/s7.png', '2020-05-16 09:55:57', '2020-05-16 11:37:48', NULL);
INSERT INTO `product` VALUES (16, '抹茶草莓卷', 'dessert', 10, '到作过后花经界论动别因易习人百于需。属世率起并海管真受原又素把式办。领严位些教山过题运己改只革。', '/image/s8.png', '2020-05-16 09:56:01', '2020-05-16 11:37:48', NULL);
